> 聚合结果在时间序列没有数据时会返回 null，因为此时如果返回0的话就不知道是因为没有数据还是真正的sum值就是0。
因此0.12.5返回 0 其实是个bug，0.13.0 修复了这一bug，后续 0.12.6也会修复这个bug。因此可能需要您对之前的代码判断做一些修改。

